import React, { Component } from 'react';
import './App.css';
import Button from './components/button';
import Table from './components/table';

const data = [
  {"PLAYER_NAME":"Lebron James", "SCORES":1332}
  ];
class App extends Component {
  render() {
    return (
      <div className="App">
        <Button></Button>
        <Table data={data}></Table>
      </div>
    );
  }
}

export default App;
